import React, { useState } from 'react'
import styled from 'styled-components';

const Contact = () => {
	const [name, setName] = useState();
	const [lastname, setLastName] = useState();
	const [email, setEmail] = useState();

	return (
		<Main>
				<Infos>Pour tout renseignement complémentaire, veuillez saisir votre nom, prénom et email. Je m'engage à vous répondre dans les 24h.</Infos>
				<Form>
					<Input 
						type="text" 
						name="name" 
						id="name" 
						placeholder="Prénom"
					/>
					<Input 
						type="text" 
						name="lastname" 
						id="lastname" 
						placeholder="Nom"
					/>
					<Input 
						type="text" 
						name="email" 
						id="email" 
						placeholder="Email"
					/>
				</Form>
		</Main>
	)
}

const Main = styled.div`
	display: flex;
	flex-direction: column;
	align-items: center;
	justify-content: center;
	height: calc(100vh - 100px);
`

const Infos = styled.p`
	width: 25vw;
	margin-bottom: 50px;
`

const Form = styled.form`
	display: flex;
	flex-direction: column;
	width: 30vw;
	height: 40vh;
`

const Input = styled.input`
	margin-bottom: 20px;
	height: 50px;
`

export default Contact
